import React from 'react';

function Results({ results }) {
  if (!results) {
    return <div>Insira os dados e clique em "Calcular" para ver os resultados.</div>;
  }

  return (
    <div>
      <h2>Resultados</h2>
      <div>Ponto Ótimo: {results.solution.join(', ')}</div>
      <div>Valor Ótimo da Função Objetivo: {results.objectiveValue}</div>
      <div>Preços Sombra: {results.shadowPrices.join(', ')}</div>
    </div>
  );
}

export default Results;
